import ArrowForwardIcon from "@material-ui/icons/ArrowForward";
import { Link } from "react-router-dom";
import "./Button.css";

function Button(props) {
  return (
    <Link to="/adventure" className="btn btn-primary button">
      <ArrowForwardIcon />
    </Link>
  );
}

export default Button;
